import React, { useState } from 'react';
import './Query.css'; // Your CSS file for styling

const Query = () => {
  const [formData, setFormData] = useState({
    name: '',
    designation: '',
    organization: '',
    officeAddress: '',
    city: '',
    emailAddress: '',
    telephoneNo: '',
    mobileNumber: '',
    professionalUpdates: 'No',
    querySubject: '',
    query: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Perform form submission logic here
    console.log(formData); // For demonstration, log the form data
  };

  return (
    <form className="form" onSubmit={handleSubmit}>
      <div className="form-grid">
        <label htmlFor="name">Name:</label>
        <input
          type="text"
          id="name"
          name="name"
          value={formData.name}
          onChange={handleChange}
        />
        <label htmlFor="name">Designation:</label>
        <input
          type="text"
          id="name"
          name="name"
          value={formData.designation}
          onChange={handleChange}
        />
        <label htmlFor="name">Office Address:</label>
        <input
          type="text"
          id="name"
          name="name"
          value={formData.officeAddress}
          onChange={handleChange}
        />
        <label htmlFor="name">City:</label>
        <input
          type="text"
          id="name"
          name="name"
          value={formData.city}
          onChange={handleChange}
        />
        <label htmlFor="name">Email Address:</label>
        <input
          type="text"
          id="name"
          name="name"
          value={formData.emailAddress}
          onChange={handleChange}
        />
        <label htmlFor="name">Telephone no.:</label>
        <input
          type="text"
          id="name"
          name="name"
          value={formData.name}
          onChange={handleChange}
        />
        <label htmlFor="name">Name:</label>
        <input
          type="text"
          id="name"
          name="name"
          value={formData.name}
          onChange={handleChange}
        />
        <label htmlFor="name">Name:</label>
        <input
          type="text"
          id="name"
          name="name"
          value={formData.name}
          onChange={handleChange}
        />

        {/* Other form fields go here */}
        {/* Repeat the structure for other form fields as needed */}

        <label htmlFor="professionalUpdates">Other Professional Updates:</label>
        <div className="radio-buttons">
          <label>
            <input
              type="radio"
              name="professionalUpdates"
              value="Yes"
              checked={formData.professionalUpdates === 'Yes'}
              onChange={handleChange}
            />{' '}
            Yes
          </label>
          <label>
            <input
              type="radio"
              name="professionalUpdates"
              value="No"
              checked={formData.professionalUpdates === 'No'}
              onChange={handleChange}
            />{' '}
            No
          </label>
        </div>

        {/* Dropdown for subject of query */}
        <label htmlFor="querySubject">Subject of Query:</label>
        <select
          id="querySubject"
          name="querySubject"
          value={formData.querySubject}
          onChange={handleChange}
        >
          <option value="">Select</option>
          {/* Add options for the dropdown */}
          <option value="Option 1">Option 1</option>
          <option value="Option 2">Option 2</option>
          {/* Add more options as needed */}
        </select>

        {/* Text area for query */}
        <label htmlFor="query">Query:</label>
        <textarea
          id="query"
          name="query"
          value={formData.query}
          onChange={handleChange}
        ></textarea>
      </div>

      <button type="submit">Submit</button>
    </form>
  );
};

export default Query;
